import Button from 'react-bootstrap/Button';
import React from 'react'
import { Container, Form, Card, Row } from "react-bootstrap"

const Auth = () => {
  return (
    <Container
      className="d-flex justify-content-center align-items-center"
      style={{
        height: window.innerHeight - 54
      }}>

      <Card style={{
        width: 600
      }} className="p-5">
        <h2 className="m-auto">Авторизация</h2>
        <Form className="d-flex flex-column">
          <Form.Control className="mt-3" placeholder="Введите ваш email..." />
          <Form.Control className="mt-3" placeholder="Введите ваш пароль..." />

          <Row>
            <Button className="mt-3 align-self-end" variant={"outline-success"}>Войти</Button>
          </Row>

        </Form>
      </Card>

    </Container>
  )
}

export default Auth
